      "normativa": "PROTOCOLOS DE AUTORIZACIÓN Y AUDITORÍA DENSITOMETRÍA ÓSEA - NORMATIVAS DE USO - REQUISITOS DE SOLICITUD DE ELEMENTOS MÉDICOS Obligación de cobertura en los siguientes casos (definición Salud) 1. Diagnóstico de Osteoporosis. En mujeres que cumplan con ambos de los siguientes criterios (a) tengan un puntaje IARO mayor o igual a 9 (nueve) sumado a alguno de los factores de riesgo (b) Estén dispuestas a realizar tratamiento específico para osteoporosis. 2. Seguimiento de Osteoporosis - En mujeres bajo tratamiento de osteoporosis no debe solicitarse una DMO de seguimiento antes de los 2 (dos) años. - No es necesario solicitar dos sitios diferentes para el diagnóstico de osteoporosis - En las mujeres jóvenes se puede solicitar DMO columna lumbar y en las mayores de 65 puede solicitarse solamente DMO de cadera. - En las pacientes con DMO normales (T score mayor a –1) el seguimiento no debe realizarse en un intervalo menor de 3 a 5 años. - Las mujeres con DMO por encima de lo normal no requieren seguimiento. - Las mujeres en programa de prevención deben ser seguidas cada 2 (dos) años hasta la estabilización de la medición. Luego debe realizarse cada 3 años. Índice IARO: Instrumento de Evaluación de Riesgo de Osteoporosis 15 puntos: para mayores de 75 años 9 puntos: entre 65 y 74 5 puntos: entre 55 y 64 años 9 puntos: si el peso es menor 60 kg 3 puntos: entre 60 y 69.9 kg 2 puntos: si no usa actualmente estrógenos Factores de Riesgo de fractura (National Osteoporosis Foundation): - DMO previa patológica - historia personal previa de fracturas - historia familiar de fracturas - delgadez (peso inferior a 60 kg) - hábito tabáquico activo 1 - utilización de esteroides V. O. durante más de 3 meses hiperparatiroidismo primario asintomático Adicionales en posmenopausia (consideración particular de acuerdo a HC): - déficit estrogénico precoz (ante de los 45 años) - caídas recientes - ingesta baja de calcio - inactividad física 2.",
