      "code": "01.01",
      "description": "CONSULTA DE RELEVAMIENTO BUCAL",
      "normativa": "INCLUYE: al código 01.01. 05.02 Se reconocerá semestralmente y hasta cumplir 12 años por tratamiento y en ambas arcadas, cualquiera fuese la técnica que se utilice. 05.03 inactivación de poli caries: se reconocerá hasta los 10 años de edad. Cuando se presente simultáneamente más de 6 caries activas en toda la boca, se permitirá por única vez como complemento de un tratamiento (por lógica debe involucrar las mismas piezas que se marquen como existentes con caries activas. 05.04 Se reconocerá con la presentación de la FP correctamente confeccionada cada 12 meses hasta los 12 años. 05.05 Ses tecór1ocerá hasta los 18 años, hasta los 8 años puede rehacerse cada 12 meses y a ry L. partir de esa edad cada 24 meses. La pieza dentaria tratada con sellante no podrá recibir obturación por un término igual al estipulado por la duración del sellante por el mismo profesional. Capítulo 7 - ODONTOPEDIATRIA 07.01 Se reconocerá hasta los 10 años. Se podrá facturarse uno cada 6 meses, con un máximo de 4 códigos por el mismo profesional. 07.02 Se reconocerá sin límite de edad. se podrá facturar un código cada 3 meseshasta un máximo de 8 códigos por el mismo profesional. Aclarar la discapacidad. (se deberá adjuntar certificado de discapacidad). 07.03 Se reconocerá hasta los 10 años. No podrá facturarse más de una corona por mes y por paciente (no se reconocerá obturación debajo de las coronas) en aquellos pacientes que con anterioridad hayan recibido en dicha pieza dentaria obturaciones por el mismo profesional, si necesitara una corona de acero deberá aclararse el motivo, en estos casos la auditoria evaluará las observaciones. Asimismo, se tendrá en cuenta el período de exfoliación de la pieza dentaria con Rx pre y post. Capítulo 8 - PERIODONCIA 08.11 Consulta periodontal: análisis detección de bolsa periodontal. Diagnóstico y plan de tratamiento. En ficha periodontal se reconocerá una sola vez. No incluye al código 01.01. 08.12. Tratamiento de gingivitis comprende detartraje manual o mecánico se reconocerá cada 12 meses y se considera un código 08.12 por arcada dentaria. 08.13 Se reconocerá con la presentación de la ficha periodontal convenientemente confeccionada. Se reconocerá cada 12 meses 08.14 Incluye al 08.11 y 08.12.se reconocerá cada 4 meses. 08.15. Incluye 08.11 y 08.12. se reconocerá cada 4 meses. Los códigos 08.14 y 08.15 comprenden todo lo que el profesional considere necesario realizar para conservar la salud periodontal del paciente. 08.16 Incluye al 08.12, 08.14 y 08.15, se reconocerá cada 24 meses, 6 códigos por arcada y entre 4 a 6 Rx por ficha. 08.17. Incluye 08.12,08.14 y 08.15., se reconocerá cada 24 meses, 6 códigos por arcadas y entre 4 a 6 Rx por arcada. Para el reconocimiento de estos códigos (08.16 - 08.17) es obligatorio la presentación de la ficha periodontal (código 0811). Todo método utilizado para resolver el problema periodontal (cirugía por colgajos, distintos procedimientos y/o técnicas, tratamiento de peri-implantitis) quedan contemplado en este capítulo, lo mismo que los injertos para tratar defectos implantarios. Ver código 1027 (injerto gingival libre). Capítuolo 9 - RADIOGRAFIA. Norma particular: Las radiografías de diagnóstico podrán ser conservadas por el profesional. No así aquellas Rx que sean comprobatorias de prácticas determinadas, pudiendo la auditoría exigir las Rx que considere necesarias al profesional en un término de tiempo que no supere los 24 meses. Ejemplo: Rx comprobatorias - endodoncia - cirugía.",
